const _ = require('lodash');

const config = {
    accountName: '5oyiw.wam',

    // beast garden
    beastgarden_battles: true,
    beastgarden_auctions: false,
    beastgarden_crafting: false,
    allowed_craft_configs: [],
    beastgarden_claim: true,
    beastgarden_minting_fruits: true,
    beastgarden_feeding_beasts: true,
    beastgarden_harvesting_fruits: true,
    beastgarden_feeding_beasts_list: require('./BG_FEEDING_BEASTS_LIST'),

    // ancient realms
    ancient_realms_fights: false,

    // realms of arkovia
    arkovia_realm_adventures: false,

    // novarally
    novarally_claim: true,
    novarally_races: true,
    novarally_repair_vehicles: true,
    novarally_buy_shop_items: true,
    novarally_race_combinations: require('./NR_RACE_COMBINATIONS'),
    novarally_join_death_rally: true,
    novarally_death_rally_combinations: require('./NR_DEATH_RALLY_COMBINATIONS'),

    // atomichub
    atomichub_cancel_invalid_sales: true,
    atomichub_sell_assets: false,
    atomichub_sell_assets_list: require('./AH_SELL_ASSETS_LIST'),
    atomichub_sell_assets2: true,
    atomichub_sell_assets_list2: require('./AH_SELL_ASSETS_LIST2'),
    atomichub_buy_assets: false,
    atomichub_buy_assets_list: require('./AH_BUY_ASSETS'),

    // mining network
    mining_network_claim_shares: false,

    // novopangea
    novopangea_play_game: false,

    // alcor
    alcor_send_orders: true,
    alcor_orders_settings: require('./ALCOR_ORDERS'),

    // wax
    claim_wax_reward: true,
};

module.exports = config;
